import NewsItem from './NewsItem'

export default class News extends Component {
  render() {
    return (
      <div className='container my-3'>
      <h2>Top Headlines</h2>
      <div className='row'>
      <NewsItem title={"cricket"} description={"play"}/>
      </div>
      <NewsItem/>
      <NewsItem/>
      </div>
    )
  }
}
